import { useEffect, useState } from 'react';
import Button from './Button.js';
import './Liste_page.css';

function Liste_page(){
    return(
        <div class="container " style={{ width: '70%', height: '600px', backgroundColor: '#202730', padding: '50px'}}>
            <div class="row justify-content-center">
                <div class="col-md-6 d-flex flex-column">
                    <Button text="Mathématique" class="matière btn-block mb-3 ml-2"></Button>
                    <Button text="Physique Chimie" class="matière btn-block mb-3"></Button>
                </div>
                <div class="col-md-6 d-flex flex-column">
                    <Button text="Histoire" class="matière btn-block mb-3"></Button>
                    <Button text="Français" class="matière btn-block mb-3"></Button>
                </div>
            </div>
        </div>
    )
}

export default Liste_page;
